import React from 'react';
import {View,Text,TouchableOpacity,Button,SafeAreaView,KeyboardAvoidingView} from 'react-native';
import {css} from '../assets/Css/css';

export default function Preditor1 (props1) {
    const [selectedValue, setSelectedValue] = useState('Bovespa')
    return (
        <SafeAreaView style = {css.fundo}>
            <KeyboardAvoidingView>
            <View style = {css.container1}>
            
                <Picker selectedValue={selectedValue} style={{ height: 50, width: 150 }} onValueChange={(itemValue, itemIndex) => setSelectedValue(itemValue)}>
                    <Picker.Item label="Bovespa" value="^BVSP" />
                    <Picker.Item label="Dow Jones Industrial Average" value="^DJI" />	NASDAQ Composto
                    <Picker.Item label="NASDAQ Composto" value="^IXIC" />
      </Picker>
                <TouchableOpacity title = "Ir para Preditor 2" onPress={()=>props1.navigation.navigate('Preditor2')} style = {css.button1}>Preditor2</TouchableOpacity>   
            </View>
            </KeyboardAvoidingView>
        </SafeAreaView>
    );
    
}
